import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';

function UserDashboardHome() {
  return <div className="bg-white p-4 rounded shadow">Welcome to your dashboard!</div>;
}

function UserPlans() {
  return <div className="bg-white p-4 rounded shadow">Browse and subscribe to plans (UI here)</div>;
}

function UserSubscriptions() {
  return <div className="bg-white p-4 rounded shadow">Manage your subscriptions (UI here)</div>;
}

function UserRecommendations() {
  return <div className="bg-white p-4 rounded shadow">Personalized recommendations (UI here)</div>;
}

function UserDashboard() {
  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold mb-4">User Dashboard</h1>
      <Routes>
        <Route path="" element={<UserDashboardHome />} />
        <Route path="plans" element={<UserPlans />} />
        <Route path="subscriptions" element={<UserSubscriptions />} />
        <Route path="recommendations" element={<UserRecommendations />} />
        <Route path="*" element={<Navigate to="." />} />
      </Routes>
    </div>
  );
}

export default UserDashboard;
